<script setup lang="ts">
import {
  IonAccordionGroup,
  IonCard,
  IonCardContent,
  IonCol,
  IonContent,
  IonGrid,
  IonPage,
  IonRow
} from '@ionic/vue';
import MilestoneAccordion from "@/components/MilestoneAccordion.vue";
import {onMounted, ref} from "vue";

export type Relationship = {
  name1: string
  name2: string
  milestones: Milestone[]
  image: string
}

export type Milestone = {
  date: Date
  description: string
}

const relationship = ref<Relationship>({
  name1: "Lisa",
  name2: "Thomas",
  image: "",
  milestones: [
    {date: new Date(2024, 0, 1, 12, 0, 0), description: " Jahrestag"},
    {date: new Date(2024, 0, 1, 12, 0, 0), description: " Verlobung"},
    {date: new Date(2024, 0, 1, 12, 0, 0), description: " Hochzeit"},
    {date: new Date(2024, 0, 1, 12, 0, 0), description: "Kind 1"},
  ]
});

const getBackgroundImage = (image: string)  => {
  if (!image) {
    return null;
  }
  return 'url("data:image/gif;base64,' + image + '")';
};

const heartBeat = ref<boolean>(false);
const beatHeart = () => {
  setInterval(() => {
    heartBeat.value = !heartBeat.value;
  }, 2000)
};
onMounted(() => {
  beatHeart();
})
</script>

<template>
  <IonPage>
    <IonContent class="content"
                v-if="relationship"
                :style="{ 'background-image': getBackgroundImage(relationship?.image) }">

      <div class="details ion-text-center">

        <IonCard>
          <IonCardContent>
            <IonGrid>
              <IonRow class="name-row">
                <IonCol>
                  <div class="name ion-text-right">{{ relationship?.name1 }}</div>
                </IonCol>
                <IonCol><span class="heart" :class="{bigHeart: heartBeat, smallHeart: !heartBeat}"></span>
                </IonCol>
                <IonCol>
                  <div class="name ion-text-left">{{ relationship?.name2 }}</div>
                </IonCol>
              </IonRow>
            </IonGrid>

            <IonAccordionGroup>
              <MilestoneAccordion v-for="milestone in relationship.milestones"
                                  :key="milestone.description"
                                  :description="milestone.description"
                                  :date="milestone.date"/>
            </IonAccordionGroup>
          </IonCardContent>
        </IonCard>

      </div>

    </IonContent>

  </IonPage>
</template>

